import React, { useState, useEffect } from 'react';
import './App.css';
import { getUsers, createUser } from './services/api.js';

function App() {
    const [users, setUsers] = useState([]);
    const [formData, setFormData] = useState({
        income: '',
        creditScore: '',
        employmentStatus: '',
        loanAmount: '',
        loanTerm: ''
    });

    useEffect(() => {
        fetchUsers();
    }, []);

    const fetchUsers = async () => {
        try {
            const usersData = await getUsers();
            setUsers(usersData);
        } catch (error) {
            console.error('Error fetching users:', error);
        }
    };

    const handleChange = (e) => {
        const { name, value } = e.target;
        setFormData({
            ...formData,
            [name]: value
        });
    };

    const handleSubmit = async (e) => {
        e.preventDefault();
        try {
            await createUser(formData);
            fetchUsers();
        } catch (error) {
            console.error('Error creating user:', error);
        }
    };

    return (
        <div className="App">
            <h1>Banking Services Platform</h1>
            <form onSubmit={handleSubmit}>
                <input type="number" name="income" value={formData.income} onChange={handleChange} placeholder="Income" required />
                <input type="number" name="creditScore" value={formData.creditScore} onChange={handleChange} placeholder="Credit Score" required />
                <input type="text" name="employmentStatus" value={formData.employmentStatus} onChange={handleChange} placeholder="Employment Status" required />
                <input type="number" name="loanAmount" value={formData.loanAmount} onChange={handleChange} placeholder="Loan Amount" required />
                <input type="number" name="loanTerm" value={formData.loanTerm} onChange={handleChange} placeholder="Loan Term" required />
                <button type="submit">Submit</button>
            </form>
            <h2>Users</h2>
            <ul>
                {users.map((user) => (
                    <li key={user.id}>
                        {user.income}, {user.creditScore}, {user.employmentStatus}, {user.loanAmount}, {user.loanTerm}
                    </li>
                ))}
            </ul>
        </div>
    );
}

export default App;
